import React from 'react';
import { useState } from 'react';
import Entry from './Entry';

const List = ({ orders }) => {

    return (
        <div className="container">
            <h1>Previous Orders</h1>
            {orders.map(order => (
                <Entry key={order.key} order={order}/>
            ))}
        </div>
    )
}

export default List
